  false,\n\t\"url\": null,\n\t\"notes\": \"Summer Low Flow Trend Indicator results,
  statewide, updated through Oct 2013. rnrnThis information is updated annually with
  an additional year of flow data. These results are provided to the Puget Sound Partnership
  for their Vital Signs (http://www.psp.wa.gov/vitalsigns/summer_stream_flows.php)
  and to the Governor's Salmon Recovery Office for the \"State of Salmon in WAtersheds\"
  report (http://stateofsalmon.wa.gov/statewide/indicators/water-quantity). rnrnThe
  attached document \"WR Indicator Outcomes Memo - 10-24-10.pdf\" describes the methodology
  for developing these indicators. rnrnThe attached document \"Low Flow Indicator
  Metadata.pdf\" describes the contents of each column. rnrnDept. of Ecology home
